	private static void problem03(){
		
		for(int a=1; a<=9;a++) {
			for(int b=2; b<=9; b++) {
				System.out.print(b+"*"+a +"="+(b*a));
				System.out.print(" ");
			}
			System.out.println();
		}
		
	}
